4 Не изнуряй себя, чтобы разбогатеть;   
Остановись и прояви понимание.   
5 Ты будешь смотреть на богатство, и его больше нет, Оно непременно обретет крылья и улетит в небо, как орёл.

4 Strenge dich nicht an, um reich zu werden;   
Halte inne und zeige Verständnis.   
5 Du wirst deinen Blick auf den Reichtum richten, und er wird nicht mehr da sein, Denn er wird sich Flügel machen und wie ein Adler in den Himmel fliegen.

4 Zengin olmak için kendini yorma;   
Dur ve anlayış göster.   
5 Zenginliğe gözlerini dikeceksin, ama artık olmayacak, Çünkü kesinlikle kanatlanıp kartal gibi gökyüzüne uçacaktır.
